        <div className='projects-container'>
            <div className='projects__text'>
                <h1> PROJECTS </h1>
                <p>We have two house designs with different parameters.
                Summer or all-season versions.
                Adjust the properties to your needs!</p>
            </div>
            <ul className='projects-wrapper'>
                <li className='projects__house'>
                    <ProjectItem
                        src='images/img-9.jpg'
                        title='H1 GLAZED'
                        // path='/services'
                        text1='35m2'
                        text2='all-season'
                        text3='6 persons'
                        text
                    />
                </li>
                <li className='projects__house'>
                    <ProjectItem
                    />
                </li>
            </ul>
        </div>
    );
}

export default Projects;
